import React, { Component } from "react";

export default class Grid extends Component {
  render() {
    const styles = {
      border: "2px solid darkblue",
      height: "50px"
    };

    return (
      <div class="container">
        <div class="row">
          <div style={styles} class="col-sm">
            1.
          </div>
          <div style={styles} class="col-sm">
            2.
          </div>
          <div style={styles} class="col-sm">
            3.
          </div>
          <div style={styles} class="col-sm">
            4.
          </div>
        </div>
      </div>
    );
  }
}
